import "./App.css"
import React,{Component} from "react"

import "antd/dist/antd.css"
import axios from "axios"

class App extends Component{
  render(){
    return (
      <div>App</div>
    )
  }

  componentDidMount(){
    axios("/api/showcase/goodsList.json?tagId=&page=1&pageSize=6&goodsIds=451311380%2C481656025%2C495616115%2C476749447%2C466554997&goodsFrom=0&isAdv=0&offlineId=0&goodsNumber=6&json=1&kdtId=1")
      .then(res=>{
        console.log(res)
      }).catch(err=>{
        console.log(err)
      })
  }
}
export default App
